import { ArgTypes } from '@storybook/angular';

// tslint:disable-next-line:typedef
function args(obj: ArgsInterface[]) {
    const result: ArgTypes;

    obj.forEach(item => {

        result[item.name] = {
            type : { name: item.type, required: item.require },
            defaultValue: item.defaultValue,
            description: item.description,
            table: {
                disable: item.disable,
                category: item.category,
                type: { summary: item.type },
                defaultValue: { summary: item.defaultValue },
            },
            options: item.options,
            control: {
              type: item.control,
              min: item.minRange,
              max: item.maxRange
            }

        };

    });

    return result;

}

// tslint:disable-next-line:no-empty-interface
interface ArgsInterface {
    name: string;
    disable?: boolean;
    require?: boolean;

    type?: any;
    defaultValue?: string;
    description?: string;
    category?: string;

    control?: 'boolean' | 'select' | 'radio' | 'range';
    options?: string[];
    minRange?: number;
    maxRange?: number;

}

import { Meta, moduleMetadata, ArgTypes } from '@storybook/angular';

export type ControlTypeInterface = 'array' | 'boolean' | 'number' | 'range' | 'object' | 'radio' | 'inline-radio' | 'check' | '	inline-check' | 'select' | 'multi-select' | 'text' | 'color' | 'date';
export interface PropertiesInterface {

    name: string;
    description?: string;
    defaultValue?: string;

    disable?: boolean;
    require?: boolean;
    type?: any;

    category?: string;

    control?: ControlTypeInterface;
    options?: string[];

    minRange?: number;
    maxRange?: number;
    stepRange?: number;
}
export interface DefaultConfigInterface {

    title: string;
    component?: any;
    includeStories?: string[];

    declarations?: any[];
    imports?: any[];

    properties ?: PropertiesInterface[];
}



export function DefaultStoryConfig(configs: DefaultConfigInterface): Meta {
    const argTypesObject: ArgTypes = {};

    configs.properties.forEach((property: PropertiesInterface) => {
        argTypesObject[property.name] = {
            ...property,
            type: { name: `${property.type}`, required: property.require },
            defaultValue: property.defaultValue,
            description: property.description,
            table: {
                disable: property.disable,
                category: property.category,
                type: { summary: `${property.type}` },
                defaultValue: { summary: property.defaultValue },
            },
            options: property.options,
            control: {
                type: property.control
            }
        };
    });

    return {
        title: configs.title,
        component: configs.component,
        decorators: [
          moduleMetadata({
            declarations: configs.declarations,
            imports: configs.imports
          }),
        ],
        argTypes: argTypesObject
    } as Meta;
}

